import Carousel from 'react-bootstrap/Carousel';
import Nav from 'react-bootstrap/Nav';
import { Link } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import './Photo.css'


import photo1 from 'https://jonahsaffranphotos.s3.us-west-1.amazonaws.com/img/beck1.jpg';
import photo2 from 'https://jonahsaffranphotos.s3.us-west-1.amazonaws.com/img/P1055040.00_00_06_29.Still001.jpg';
import photo3 from 'https://jonahsaffranphotos.s3.us-west-1.amazonaws.com/img/P1055040.00_00_06_32.Still002.jpg';
import photo4 from 'https://jonahsaffranphotos.s3.us-west-1.amazonaws.com/img/P1055040.00_00_06_34.Still003.jpg';
import photo5 from 'https://jonahsaffranphotos.s3.us-west-1.amazonaws.com/img/P1055088.00_00_03_25.Still004-2.jpg';
import photo6 from 'https://jonahsaffranphotos.s3.us-west-1.amazonaws.com/img/P1055180.jpg';
import photo7 from 'https://jonahsaffranphotos.s3.us-west-1.amazonaws.com/img/P1055088.00_00_25_18.Still009-2.jpg';


import photo8 from 'https://jonahsaffranphotos.s3.us-west-1.amazonaws.com/img/lane-1.png';
import photo9 from 'https://jonahsaffranphotos.s3.us-west-1.amazonaws.com/img/collage 4-4.png';

import photo10 from 'https://jonahsaffranphotos.s3.us-west-1.amazonaws.com/img/Panama1.jpg';
import photo11 from 'https://jonahsaffranphotos.s3.us-west-1.amazonaws.com/img/Panama2.jpg';
import photo12 from 'https://jonahsaffranphotos.s3.us-west-1.amazonaws.com/img/Panama3.jpg';
import photo13 from 'https://jonahsaffranphotos.s3.us-west-1.amazonaws.com/img/Panama4.jpg';

import photo14 from 'https://jonahsaffranphotos.s3.us-west-1.amazonaws.com/img/sam 04.jpg';
import photo15 from 'https://jonahsaffranphotos.s3.us-west-1.amazonaws.com/img/sam 05.jpg';
import photo16 from 'https://jonahsaffranphotos.s3.us-west-1.amazonaws.com/img/ben backside windup.jpg';
import photo17 from 'https://jonahsaffranphotos.s3.us-west-1.amazonaws.com/img/ben good backside wind up.jpg';
import photo18 from 'https://jonahsaffranphotos.s3.us-west-1.amazonaws.com/img/real sam air.jpg';
function Photo() {
  return (
    <>
      <Nav justify variant="tabs" activeKey="1">
        <Nav.Item>
          <Nav.Link as={Link} to="/" eventKey="0">Home</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link as={Link} to="/photo" eventKey="1">Photography</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link as={Link} to="/film" eventKey="2">Film</Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link as={Link} to="/Contact" eventKey="3"> Contact </Nav.Link>
        </Nav.Item>
      </Nav>
      <div className="Carousel-container">
        <Carousel>
          <Carousel.Item>
            <img
              className="d-block w-100"
              src={photo1}
              alt="First Slide"
            />
          </Carousel.Item>
          <Carousel.Item>
            <img
              className="d-block w-100"
              src={photo2}
              alt="Second Slide"
            />
          </Carousel.Item>
          <Carousel.Item>
            <img
              className="d-block w-100"
              src={photo}
              alt="Third slide"
            />
          </Carousel.Item>
        </Carousel>
      </div>
      <div className="Carousel-container">
        <Carousel>
          <Carousel.Item>
            <img
              className="d-block w-100"
              src={photo}
              alt="Second Slide"
            />
          </Carousel.Item>
          <Carousel.Item>
            <img
              className="d-block w-100"
              src={photo}
              alt="Second Slide"
            />
          </Carousel.Item>
          <Carousel.Item>
            <img
              className="d-block w-100"
              src={photo}
              alt="Third slide"
            />
          </Carousel.Item>
        </Carousel>
      </div>
      <div className="Carousel-container">
        <Carousel>
          <Carousel.Item>
            <img
              className="d-block w-100"
              src={photo}
              alt="Second Slide"
            />
          </Carousel.Item>
          <Carousel.Item>
            <img
              className="d-block w-100"
              src={photo}
              alt="Second Slide"
            />
          </Carousel.Item>
          <Carousel.Item>
            <img
              className="d-block w-100"
              src={photo}
              alt="Third slide"
            />
          </Carousel.Item>
        </Carousel>
      </div>
    </>
  );
}
export default Photo;
